import SearchBar from "./components/SearchBar/SearchBar";
import { Link } from "react-router-dom";


const Nav=({onSearch})=>{
    return(
        <nav className={style.Nav}>
       <Link>

        <button>Home</button>
        <button>About</button>
        <SearchBar onSearch={onSearch}/>
    
        </Link>
     </nav>
    )
}

export default Nav;
